import React from "react";
import '../Css/Signup.css';
import img5 from '../image/img6.jpg';


const Signup = () => {
    return (
      <>
      
<section className="signup">
     <div className="div1">
       <img src={img5} alt="formpic"/>
     </div>
     <div className="div2"> </div>
      </section>
     
      </>

    );
  }
  
  export default Signup;
